create table products (
	product_name VARCHAR(50),
	price DECIMAL(8,2),
	description TEXT,
	rating INT,
	review TEXT,
	availability VARCHAR(50),
	pin_code VARCHAR(50),
	category VARCHAR(14),
	subcategory VARCHAR(11),
	brand VARCHAR(50),
	manufacturer VARCHAR(50),
	weight DECIMAL(3,1),
	dimensions TEXT,
	color VARCHAR(50),
	material TEXT,
	size VARCHAR(6),
	model_number TEXT,
	warranty INT,
	shipping_cost DECIMAL(4,2),
	stock_quantity INT,
	release_date DATE,
	expiration_date DATE,
	discount_percentage DECIMAL(4,2),
	sales_tax_percentage DECIMAL(4,2),
	profit_margin_percentage DECIMAL(4,2),
	return_policy TEXT,
	special_features TEXT,
	best_seller VARCHAR(50),
	new_arrival VARCHAR(50),
	top_rated VARCHAR(50)
);
